import React from 'react';
import './LoginForm.css';
import Inputtag from '../inputtag/inputtag';

const LoginForm = () => {
  return (
    <div className='container'>
      <div className='wrapper'>
        <div className='img_cont'>
          <img src="https://kongu.ac.in/facilities/images/bus.JPG" alt="Bus_img" className='side_img' />
        </div>
        <div className='form_cont'>
          <form action='' className='side_form'>
            <h1 className='heading'>LOGIN</h1>

            {/* Bus ID Input */}
            <Inputtag
              label="Bus ID (பேருந்து எண்):"
              placeholder="Enter your Kongu Bus ID"
            />

            {/* Bus Registration Number Input */}
            <Inputtag
              label="Bus Registration Number (பேருந்து பதிவு எண்):"
              placeholder="Enter your Bus Registration Number"
            />

            {/* Submit Button */}
            <button type="submit">Login</button>
          </form>
        </div>
      </div>
    </div>
  );
}

export default LoginForm;
